import React, {
    Component,
    Children
} from 'react';
import {
    array
} from 'prop-types';
import {
    forEachChild
} from 'typescript';

class FetchConnectApi extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Listing: []
        }
    }


    setProp(propData) {
        this.state.setProp({
            jsonData: []
        });
    }

    /* function execution occurs
     after async request completed */
    componentDidMount() {
        fetch('https://www.reddit.com/r/nonbinary.json')
            .then(Listing => {
                if (!Listing.ok) {
                    throw Error("Network request failed")
                }
                return Listing;
            })
            .then(data => data.json())
            .then(data => this.setState({
                Listing: data
            }));


    }


    render() {
        const dataObj = null;
        var jstring = JSON.stringify(this.state.Listing['data']);
        if (!this.state.results) console.log(this.state.results);
        if (this.state.requestFailed) return <p > Failed! < /p>
        if (!this.state.results) return <div > {} < /div>
    }
}
export default FetchConnectApi;
